алевролиты мелкозернистые, аргиллиты с пластом (0,5 м) грифеевых известняков;
вверху пачка (70-250 м) песчаников средне-и мелкозернистых, редко грубозернистых;
конкреции.

КУРУМСКАЯ СВИТА. Два седиментационных ритма (180-310 м и 150-280 м), в нижних частях которых (40-50 м и 80-90 м) алевролиты разнозернистые с
редкими пластами песчаников, в верхних (120-250 м и 60-200 м) песчаники мелко- и среднезернистые с пластами (до 10 м) алевролитов;
линзы (до 0,5 м) гравелитов и конгломератов

ЧЕКАНОВСКАЯ СВИТА
в нижней части (до 25 м) аргиллиты, в верхней (до 6 м) чередование битуминозных органогенных известняков (5-10 см) и аргиллитов (1-5 см) черных сажистых алевритистых;
мелкие фосфатно-карбонатные конкреции.

УСТЬ-КЕЛЬТЕРСКАЯ СВИТА (СЕРИЯ)
в низах (70-160 м) аргиллиты и алевролиты пестроцветные разнозернистые с редкими прослоями пестроцветных туфопесчаников, туфоалевролитов и туфов; в западных районах покровы базальтов, пикритов, трахипикритов; в верхней части песчаники мелко-, реже среднезернистые с пакетами (15 м) переслаивания алевролитов и песчаников;
внутриформационные конгломераты, конкреции.

