 ("колымиевый горизонт'}

Пионерская свита (верхняя часть), верхняя подсвита
тёмно-серые до чёрных глинистые и углеродисто-глинистые сланцы с прослоями и пачками известковистых алевролитов;
обломки призматического слоя раковин колымиид, гастроподы

Беглинская свита, средняя подсвита
тёмно-серые алевролиты, аргиллиты,
конкреции сульфидов;

Нонкичанская свита
песчаники тёмно-серые мелкозернистые комковатые с текстурами взмучивания;
колымииды

